import axios from "axios";

// NOTE withCredentials : false 일때 서버에 요청을 보낼 때 쿠키(인증정보)를 포함해 보내지 않음
const loginHandler = async ev => {
  ev.preventDefault() // 중요: 브라우저의 기본 제출 동작을 막음
  const response =  await axios.post('http://localhost:8080/auth/login', {
    username: 'test',
    password: '123qwe!@#'
  }, {withCredentials: true});

  console.dir(response);
}

export default function Login() {
    return (
        <form class="col s12" method="post"
              id="signupForm" onSubmit={loginHandler}>
          <div class="row">
            <div class="input-field col s7 ">
              <i class="material-icons prefix">account_circle</i>
              <input type="text" placeholder="userId"
                     class="validate" name="username"/>
            </div>
          </div>
          <div class="row">
            <div class="input-field col s7 ">
              <i class="material-icons prefix">account_circle</i>
              <input type="password"
                     placeholder="password" class="validate" name="password"/>
              <span  class="helper-text"></span>
            </div>
          </div>
          <div class="row">
            <button class="btn waves-effect waves-light offset-s1 col-6" type="submit"
                    name="action">
              Submit
              <i class="material-icons right">send</i>
            </button>
          </div>
        </form>
    )
}
